    @test_int [(a + a*sec(e + f*x))^2/(c - c*sec(e + f*x))^5, x, 18, (a^2*x)/c^5 - (4*a^2*tan(e + f*x))/(9*c^5*f*(1 - sec(e + f*x))^5) - (16*a^2*tan(e + f*x))/(63*c^5*f*(1 - sec(e + f*x))^4) - (37*a^2*tan(e + f*x))/(105*c^5*f*(1 - sec(e + f*x))^3) - (179*a^2*tan(e + f*x))/(315*c^5*f*(1 - sec(e + f*x))^2) - (494*a^2*tan(e + f*x))/(315*c^5*f*(1 - sec(e + f*x)))]


