    @test_int [(a + a*sec(e + f*x))^3*(c - c*sec(e + f*x))^1, x, 9, a^3*c*x + (a^3*c*atanh(sin(e + f*x)))/f - (a^3*c*tan(e + f*x))/f - (a^3*c*sec(e + f*x)*tan(e + f*x))/f - (a^3*c*tan(e + f*x)^3)/(3*f)]
